struct BankAccount {
    uint256 accountID;
    uint256 balance;
    address owner;
}

contract Account {
    BankAccount[] public bAccount;

    function create1(
        uint256 _accountId,
        uint256 _balance,
        address _owner
    ) public {
        bAccount.push(BankAccount(_accountId, _balance, _owner));
    }

    function create2(
        uint256 _accountId,
        uint256 _balance,
        address _owner
    ) public {
        bAccount.push(
            BankAccount({
                accountID: _accountId,
                balance: _balance,
                owner: _owner
            })
        );
    }

    function create3(
        uint256 _accountId,
        uint256 _balance,
        address _owner
    ) public {
        BankAccount memory newVar;
        newVar.accountID = _accountId;
        newVar.balance = _balance;
        newVar.owner = _owner;
        bAccount.push(newVar);
    }

    function getting(uint256 index)
        public
        view
        returns (
            uint256 accountID,
            uint256 balance,
            address owner
        )
    {
        BankAccount storage newVar = bAccount[index];
        return (newVar.accountID, newVar.balance, newVar.owner);
    }
}

